Large Food Retail:
Rate of adults per large food retail represents the total population per one large food retail (10,000 square feet or larger) in a given geography.&nbsp;<br />
<br />
You can explore large food retail across New York City on the&nbsp;<a href="https://data.cccnewyork.org/assetmapping#?domain=1245&amp;assets=Food%20Retail%2FTraditional%20Food%20Retail&amp;communities=8%7C17" target="_blank">Map Community Resources</a>&nbsp;tool.&nbsp;
